import { Component, OnInit } from '@angular/core';
import { jsPDF } from 'jspdf';

import { HomeService } from '../core/usuario.service';





@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

  constructor(private servico: HomeService) { }

  idBuscado: any;
  usuario: any;
  

  ngOnInit(): void {
    
  }

  buscarId() {
    this.servico.buscarId(this.idBuscado).subscribe(objetos => this.usuario = objetos);
  }

  gerar() {

    alert(`O certificado do Trabalho: ${this.usuario.Nome_trabalho}, foi gerado com sucesso.`);

    var doc = new jsPDF({
      orientation: 'landscape',
      format: [700, 500]
  })

  var img64 = " data:image/png;base64,";
    
    
        doc.addImage(img64, 'JPG', 0, 0, 0, 0);
        doc.setFont("Times");
        doc.setFontSize(35);
        doc.text(this.usuario.Orientador +  ", " + this.usuario.Coorientador + this.usuario.autor_1 + ", " + this.usuario.autor_2 + ", " + this.usuario.autor_3 + ", " + this.usuario.autor_4 + ", ", 280, 183.2);
        doc.text(this.usuario.autor_5 , 190, 200);
        doc.text(" '' " + this.usuario.Nome_trabalho + " '' "  , 250, 240);
        doc.save('Certificado.pdf');



    






  }



}
